ill be marked with its correct solution.\",\"a11yRetry\":\"Retry the task. Reset all responses and start the task over again.\",\"textField\":\"To : John Parker (john.parker@gmail.com)\\nSubject : My trip\\n\\nHello John,\\n \\nHow *are:v.be* you? Last month, my family and I *went:v.act* on a trip to Egypt. It *was:v.be* very hot and sunny there. We *rode:v.act* camels to the Pyramids of Giza. They *were:v.be* very big. I *took:v.act* a lot of photos. We *saw:v.act* mummies at the museum. They *were:v.be* scary, but they *were:v.be* interesting too! I *liked:v.act* the mummies&#039; treasures the most! Egypt *was:v.be* fun!\\n\\nKevin\"},\"library\":\"H5P.DragText 1.8\",\"metadata\":{\"contentType\":\"Drag Text\",\"license\":\"U\",\"title\":\"E-mail\",\"authors\":[],\"changes\":[],\"extraTitle\":\"E-mail\"},\"subContentId\":\"22d0543c-3e4f-42cb-b46b-cdd00b39becc\"},\"useSeparator\":\"auto\"}]}","library":"H5P.Column 1.13","contentUrl":".","metadata":{"license":"U","title":"Task 1","defaultLanguage":"en"},"scripts":["/api/v1/h5p/libraries/H5P.AdvancedText-1.1/text.js?version=1.1.11","/api/v1/h5p/libraries/H5P.Image-1.1/image.js?version=1.1.11","/api/v1/h5p/libraries/jQuery.ui-1.10/h5p-jquery-ui.js?version=1.10.19","/api/v1/h5p/libraries/H5P.Transition-1.0/transition.js?version=1.0.4","/api/v1/h5p/libraries/Tether-1.0/scripts/tether.min.js?version=1.0.2","/api/v1/h5p/libraries/Drop-1.0/js/drop.min.js?version=1.0.2","/api/v1/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-help-dialog.js?version=1.3.10","/api/v1/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-message-dialog.js?version=1.3.10","/api/v1/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-progress-circle.js?version=1.3.10","/api/v1/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-simple-rounded-button.js?version=1.3.10","/api/v1/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-speech-bubble.js?version=1.3.10","/api/v1/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-throbber.js?version=1.3.10","/api/v1/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-tip.js?vers
